import React from 'react';
import './List.scss';

function List() {
	return (
		<div id="list">
			{[
				<Shooping 
					urlImage='someImage'
					text='This is the text from the first product'
					arrTags={['firstTag', 'secondTag', 'thirdTag']}    
				/>,
				<Shooping 
					urlImage='otherImage'
					text='This is the text from the second product'
					arrTags={['firstTag', 'thirdTag']}    
				/>
			]
			}
		</div>
	);
}

export default List;
